Here's a sample code snippet in GNU Octave to solve the problem:

```octave
function greatest_length_saved = save_length(O, H, C, D)
  % Define the line segment between C and D
  DC = D - C;
  DC_norm = norm(DC);

  % Define the parametric equation for the line segment
  P = @(t) (140/2) * t * DC/DC_norm + D;

  % Define the function to minimize: sum of lengths of HP and OP
  f = @(t) norm(H - P(t)) + norm(O - P(t));

  % Find the minimum value of f(t) using fminunc
  t_opt = fminunc(f, 0, 1);

  % Calculate the lengths of HP and OP at the optimal t
  HP_length = norm(H - P(t_opt));
  OP_length = norm(O - P(t_opt));

  % Calculate the total length of the original ropes
  total_length = norm(H - C) + norm(H - D);

  % Calculate the length saved
  greatest_length_saved = total_length - HP_length - OP_length;
endfunction

% Define the points
O = [0, 0];
H = [0, 2.5];
C = [-1, -1];
D = [1.5, -0.3];

% Call the function to find the greatest length saved
greatest_length_saved = save_length(O, H, C, D);

% Display the result
disp(greatest_length_saved);
```

