% Define the edges and face diagonals
edges = [1 2; 2 3; 3 4; 4 1; 5 6; 6 7; 7 8; 8 5; 1 5; 2 6; 3 7; 4 8];
face_diagonals = [1 3; 2 4; 5 7; 6 8; 1 7; 2 8; 3 5; 4 6];

