% Function to check if two lines are skew
function is_skew = check_skew(line1, line2, vertices)
  p1 = vertices(line1(1), :);
  p2 = vertices(line1(2), :);
  p3 = vertices(line2(1), :);
  p4 = vertices(line2(2), :);

  % Direction vectors
  d1 = p2 - p1;
  d2 = p4 - p3;

  % Vector between points on the lines
  w = p1 - p3;

  % Cross product of direction vectors
  cross_d = cross(d1, d2);

  % Check if lines are parallel
  if norm(cross_d) < 1e-6
    is_skew = false;
    return;
  end

  % Check if lines intersect
  t = dot(cross(w, d2), cross_d) / dot(cross_d, cross_d);
  u = dot(cross(w, d1), cross_d) / dot(cross_d, cross_d);

  is_skew = (t >= 0 && t <= 1 && u >= 0 && u <= 1) == false;
end

