rationale:
We can write
\[\overrightarrow{OP} = \overrightarrow{OA} + (1 - t) \overrightarrow{OA} + t \overrightarrow{OB}.\]We can also set $O$ as the origin.  Then the expression $(1 - t) \overrightarrow{OA} + t \overrightarrow{OB}$ parameterizes points on line $AB.$  Adding $\overrightarrow{OA}$ shifts the line by this vector.

[asy]
unitsize (2 cm);

pair A, B, O, P;

O = (0,0);
A = (1,0);
B = dir(60);
P = A + sqrt(3)/2*dir(30);

draw(A--B--O--cycle);
draw(A--(A + A - O),dashed);
draw((A + A - O + 2*(B - A))--(A + A - O + A - B),red);
draw(A--P);

label("$A$", A, S);
label("$B$", B, N);
label("$O$", O, SW);
label("$P$", P, NE);
label("$1$", (O + A)/2, S);
