[asy]
import three;

size(250);
currentprojection = perspective(6,3,2);

triple I = (1,0,0), J = (0,1,0), K = (0,0,1), O = (0,0,0);
triple P = (1,2,3), Q = (1,2,-3), R = (1,-2,3), S = (1,3,3);

draw(O--4*I, Arrow3(6));
draw(O--4*J, Arrow3(6));
draw(O--4*K, Arrow3(6));
draw(O--P);
draw(O--Q);
draw(O--R);
draw(P--Q--R--S,dashed);

label("$x$", 4.5*I);
label("$y$", 4.5*J);
label("$z$", 4.5*K);

dot("$P = (1,2,3)$", P, N);
dot("$Q = (1,2,-3)$", Q, SE);
dot("$R = (1,-2,3)$", R, NW);
dot("$S = (1,3,3)$", S, SE);
[/asy]

