    for i = 1:length(digits)
        for j = i:length(digits)
            for k = i:j
                number = strjoin(digits(k), "");
                if number == reverse(number)
                    num_palindromes = num_palindromes + 1;
                end
            end
        end
    end
    return num_palindromes;
end

