inverse = @(m, n) (abs(m) <= abs(n)) <= (m^2 <= n^2);

% Contrapositive: If m^2 <= n^2, then |m| <= |n|
contrapositive = @(m, n) (m^2 <= n^2) <= (abs(m) <= abs(n));

