    for n = n_values
        if ~original_proposition(m, n) || ~converse(m, n) || ~inverse(m, n) || ~contrapositive(m, n)
            all_true = false;
            break;
        end
    end
    if ~all_true
        break;
    end
end

% Output the number of true statements
