```octave
function k = find_k()
    % Find the roots of the polynomial
    roots = roots([1, -52, 581, -k]);

    % Check if the roots are prime numbers
    for i = 1:length(roots)
        root = round(roots(i));
        if isprime(root) == 0 % If the root is not a prime number
