function af2bf2cf2 = centroid_orthocenter_midpoint(a, b, c)
  % Calculate the coordinates of the vertices A, B, and C
  A = [0, 0];
  B = [b, 0];
  C = [a, c];

  % Calculate the centroid G
  G = (A + B + C) / 3;

  % Calculate the orthocenter H
  h = sqrt((2*a^2 + 2*b^2 - c^2) / (4*a*b));
  H = [(a*b*(b-c)*G(1) + a^2*(b+c)*G(2)) / (2*a^3),
