function smallest_area = find_smallest_area()
    min_area = inf;

    for i = 1:100
        for j = 1:100
            side1 = i;
            side2 = j;

            side1_new = round(1.3 * side1);
            side2_new = round(0.8 * side2);

            if isinteger(side1_new) && isinteger(side2_new)
