octave_code:
% Define the function to check if a polynomial has integer zeros
function has_integer_roots(a, b, c)
    discriminant = b^2 - 4 * a * c;
    return (discriminant >= 0) && (isinteger(roots([a, b, c])));
end

% Initialize a set to store the solutions
solutions = [];

% Loop through all possible values of c
for c = 2010:-1:1
    % Loop through all possible values of a
    for a = 1:-1:100
        % Loop through all possible values of b
        for b = -100:100
            % Check if the polynomial has integer zeros
            if has_integer_roots(a, b, c)
                % Add the polynomial to the solutions set
                solutions = [solutions [a, b, c]];
            end
        end
    end
end

% Display the number of unique solutions
num_solutions = length(unique(solutions));
disp(num_solutions);

