function is_prime(n)
    if (n < 2)
        return false;
    endif
    for i = 2:sqrt(n)
        if (n % i == 0)
            return false;
        endif
    endfor
    return true;
endfunction
```

In this script, we first check if the number is less than 2, as 2 is the smallest prime number. Then, we loop through all the numbers from 2 up to the square root of the given number (`sqrt(n)`) and check if the given number is divisible by any of them. If it is, the function returns false, indicating that the number is not prime. If the loop completes without finding any divisors, the function returns true, indicating that the number is prime.

Now, to check if $2003$ is prime, we simply call the function:

```
is_prime(2003)
```

This script will work for any given number, not just $2003$.

