Here's a brief outline of the steps:

1. Find the equation of the tangent line using the point-slope form.
2. Solve the system of equations formed by the circle equation and the tangent line equation to find the coordinates of the point of contact $(a,b)$.
3. Compute $a + b$.

Here's the code for Octave to solve the problem:

```
% Define the center and radius of the circle
Cx = 0;
Cy = 0;
R = 1994;

% Define the point where the tangent line is drawn
Px = 2 * 1994;
Py = 2 * 1994;

% Find the slope of the tangent line
m = (Py - Cx) / (Px - Cx);

% Find the y-intercept of the tangent line
b = Py - m * Px;

% Solve the system of equations formed by the circle equation and the tangent line equation
% to find the coordinates of the point of contact (a,b)
x = (-b + sqrt(b^2 - R^2 + m^2 * R^2)) / (m^2 + 1);
y = m * x + b;

% Compute a + b
