function max_volume = max_cone_volume(r)
    h = 1;
    V = (1/3)*pi*r^2*h;
    max_V = V;
    while (h > 0)
        h = h - 0.01;
        V = (1/3)*pi*r^2*h;
        if (V > max_V)
            max_V = V;
        end
    end
    max_volume = max_V;
end

