Here's a simple script that calculates the factorial of a number and checks if the result is divisible by the given number:

```octave
function divisible = check_divisibility(n, divisor)
    fact = 1;
    for i = 2:n
        fact = fact * i;
        if mod(fact, divisor) ~= 0
            divisible = false;
            break;
        end
    end
    divisible = mod(fact, divisor) == 0;
end
```

You can call this function with the desired number and divisor to find the answer:

```octave
