function max_intersections(x1, y1, r1, x2, y2, r2)
    dx = x1 - x2;
    dy = y1 - y2;
    a = dx^2 + dy^2;
    b = 2 * (dx * (x1 * x1 + y1 * y1 - r1^2) + dy * (2 * x1 * x2 + 2 * y1 * y2) + x2^2 + y2^2 - r2^2);
    c = (x1 * x1 + y1 * y1 - 2 * x1 * x2 - 2 * y1 * y2 + r1^2 - r2^2)^2;
    delta = b^2 - 4 * a * c;
    if (delta >= 0)
